<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta
      name="viewport"
      content="width=device-width,user-scalable=no,initial-scale=1.0, minimum-scale=1.0,maximum-scale=1.0"
    />
    <title>Лига Ставок</title>
    <style>
      article,
      aside,
      details,
      figcaption,
      figure,
      footer,
      header,
      hgroup,
      menu,
      nav,
      section {
        display: block;
      }
      html,
      body,
      div,
      span,
      applet,
      object,
      iframe,
      h1,
      h2,
      h3,
      h4,
      h5,
      h6,
      p,
      blockquote,
      pre,
      a,
      abbr,
      acronym,
      address,
      big,
      cite,
      code,
      del,
      dfn,
      em,
      img,
      ins,
      kbd,
      q,
      s,
      samp,
      small,
      strike,
      strong,
      sub,
      sup,
      tt,
      var,
      b,
      u,
      i,
      center,
      dl,
      dt,
      dd,
      ol,
      ul,
      li,
      fieldset,
      form,
      label,
      legend,
      table,
      caption,
      tbody,
      tfoot,
      thead,
      tr,
      th,
      td,
      article,
      aside,
      canvas,
      details,
      embed,
      figure,
      figcaption,
      footer,
      header,
      hgroup,
      menu,
      nav,
      output,
      ruby,
      section,
      summary,
      time,
      mark,
      audio,
      video,
      button {
        margin: 0;
        padding: 0;
        border: 0;
        font-size: 100%;
        font: inherit;
        vertical-align: baseline;
        box-sizing: border-box;
        color: #fff;
        transition: 0.3s;
        font-family: Montserrat;
      }
      img,
      svg {
        transition: 0.3s;
      }
      a:hover,
      button:hover {
        cursor: pointer;
        opacity: 0.7;
      }
      .dnone {
        display: none;
      }
      a {
        text-decoration: none;
      }
      input {
        box-sizing: border-box;
      }
      .free_img {
        position: relative;
        height: 0px;
        width: 0px;
        display: flex;
        justify-content: center;
        align-items: center;
      }
      * {
        opacity: 0.3s;
      }
      body,
      html {
        overflow: hidden;
      }
      .overNot {
        width: 101vw;
        height: 101vh;
        position: absolute;
        display: none;
        z-index: 200;
      }
      .overNot.show {
        display: block;
      }
      .overFinal {
        width: 101vw;
        height: 101vh;
        position: absolute;
        display: none;
        z-index: 0;
      }
      .overFinal.show {
        display: block;
        z-index: 999999;
      }
      .final {
        height: 100vh;
        width: 100vw;
        position: absolute;
      }
      .final img {
        width: 50vw;
        position: absolute;
        opacity: 0;
        z-index: 0;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
      }
      .final img.show {
        transition: opacity 0.3s;
      }
      .final img.show.show {
        z-index: 10;
        opacity: 1;
      }
      .final img.show.finalImg {
        z-index: 9999;
      }
      .content {
        height: 100vh;
        width: 100vw;
        display: flex;
        justify-content: center;
        align-items: center;
        overflow: hidden;
      }
      .overBtn {
        width: 101vw;
        height: 101vh;
        position: absolute;
        z-index: 0;
      }
      .overBtn.show {
        z-index: 100;
      }
      .overlay {
        position: absolute;
        z-index: 0;
        opacity: 0;
        transition: opacity 0.3s;
      }
      .overlay img {
        width: 101vw;
        height: 101vh;
      }
      .overlay.show {
        z-index: 10;
        opacity: 1;
      }
      .bg {
        position: absolute;
        z-index: 1;
      }
      .bg img {
        width: 101vw;
        height: 101vh;
      }
      .logo {
        height: 100vh;
        width: 100vw;
        position: absolute;
        z-index: 2;
      }
      .logo img {
        width: 10vw;
        position: absolute;
        left: 50%;
        transform: translate(-50%);
        top: 2vh;
      }
      .title {
        height: 100vh;
        width: 100vw;
        position: absolute;
      }
      .title img {
        z-index: 2;
        width: 60vw;
        position: absolute;
        left: 50%;
        transform: translate(-50%);
        top: 10vh;
      }
      .balance {
        height: 100vh;
        width: 100vw;
        position: absolute;
      }
      .balance img {
        width: 15vw;
        z-index: 2;
        position: absolute;
        left: 50%;
        transform: translate(-50%);
        top: 17vh;
        opacity: 0;
        transition: opacity 0.3s;
      }
      .balance .allBalanceImg.show {
        opacity: 1;
      }
      .items {
        height: 100vh;
        width: 100vw;
        display: flex;
        justify-content: center;
        align-items: center;
        position: absolute;
        overflow: hidden;
      }
      .gates {
        position: absolute;
        width: 100vw;
        height: 100vh;
      }
      .gates img {
        width: 45vw;
        z-index: 2;
        position: absolute;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
      }
      .gateKeepper {
        position: absolute;
        width: 100vw;
        height: 100vh;
      }
      .gateKeepper svg {
        z-index: 6;
        width: 17vw;
        position: absolute;
        height: 36%;
        top: 56%;
        left: 50%;
        transform: translate(-50%, -40%);
      }
      .gateKeepper #gateKeeperSvg.gateKeepperLeftAnim {
        animation: gateKeepperLeftAnim 0.3s linear forwards;
      }
      .gateKeepper #gateKeeperSvg.gateKeepperRightAnim {
        animation: gateKeepperRightAnim 0.3s linear forwards;
      }
      @keyframes gateKeepperLeftAnim {
        0% {
          top: 53%;
          left: 50%;
          transform: translate(-50%, -40%);
        }
        to {
          top: 53%;
          left: 50%;
          transform: translate(-130%, -40%);
        }
      }
      @keyframes gateKeepperRightAnim {
        0% {
          top: 53%;
          left: 50%;
          transform: translate(-50%, -40%);
        }
        to {
          top: 53%;
          left: 50%;
          transform: translate(30%, -40%);
        }
      }
      .target {
        position: absolute;
        width: 100vw;
        height: 100vh;
        opacity: 1;
        transition: opacity 0.3s;
      }
      .target img {
        z-index: 4;
        width: 6vw;
        position: absolute;
        cursor: pointer;
      }
      .target img.hide {
        opacity: 0;
        display: none;
      }
      .target .tr {
        z-index: 2;
      }
      .targetLeft img {
        top: 50%;
        left: 50%;
        transform: translate(-350%, -145%);
      }
      .targetCenter img {
        top: 50%;
        left: 50%;
        transform: translate(-50%, -145%);
      }
      .targetRight img {
        top: 50%;
        left: 50%;
        transform: translate(240%, 80%);
      }
      .ball {
        position: absolute;
        width: 100vw;
        height: 100vh;
        display: none;
      }
      .ball img {
        width: 8vw;
        position: absolute;
        left: 50%;
        transform: translate(-50%);
        bottom: 0;
        z-index: 7;
      }
      .ball.show {
        display: block;
      }
      @media (min-aspect-ratio: 1/1) {
        .titleVertImg,
        .bg .bgVert {
          display: none;
        }
        .bg .bgHor {
          display: block;
        }
        .final img {
          width: 40vw;
        }
        .ball .firstBallImg.ballAnimLeft {
          animation: ballAnimLeft 0.5s linear forwards;
        }
        .ball .firstBallImg.ballAnimCenter {
          animation: ballAnimCenter 0.5s linear forwards;
        }
        @keyframes ballAnimLeft {
          0% {
            bottom: 0;
            left: 50%;
            transform: translate(-50%) scale(1);
          }
          to {
            bottom: 54.5vh;
            left: 32%;
            transform: translate(-50%) scale(0.6);
          }
        }
        @keyframes ballAnimCenter {
          0% {
            bottom: 0;
            transform: scale(1);
            left: 50%;
            transform: translate(-50%);
          }
          to {
            bottom: 54.5vh;
            left: 50%;
            transform: translate(-50%) scale(0.6);
          }
        }
        .ball .firstBallImg.ballAnimright {
          animation: ballAnimright 0.5s linear forwards;
        }
        @keyframes ballAnimright {
          0% {
            bottom: 0;
            transform: scale(1);
            left: 50%;
            transform: translate(-50%);
          }
          to {
            bottom: 25vh;
            left: 50%;
            transform: translate(167%) scale(0.6);
          }
        }
      }
      @media (max-aspect-ratio: 1/1) {
        .balance img {
          width: 40vw;
          top: 35vh;
        }
        .title .titleVertImg {
          display: block;
          top: 15vh;
        }
        .titleHorImg {
          display: none;
        }
        .logo img {
          top: 4vh;
          width: 14vh;
        }
        .title img {
          width: 90vw;
        }
        .ball img {
          width: 8vh;
          bottom: 3vh;
        }
        .target img {
          width: 5vh;
        }
        .targetLeft img {
          top: 56%;
          left: 40%;
          transform: translate(-280%, -115%);
        }
        .targetCenter img {
          top: 56%;
          left: 50%;
          transform: translate(-50%, -115%);
        }
        .targetRight img {
          top: 60%;
          left: 50%;
          transform: translate(250%, 50%);
        }
        .gates img {
          width: 40vh;
          top: 58%;
        }
        .gateKeepper svg {
          width: 17vh;
          top: 60%;
          height: 16%;
        }
        .final img {
          width: 40vh;
        }
        .bg .bgVert {
          display: block;
        }
        .bg .bgHor {
          display: none;
        }
        .ball .firstBallImg.ballAnimLeft {
          animation: ballAnimLeft 0.5s linear forwards;
        }
        @keyframes ballAnimLeft {
          0% {
            bottom: 3vh;
            left: 38vw;
            transform: scale(1);
          }
          to {
            bottom: 43.5vh;
            left: 6.5vw;
            transform: scale(0.6);
          }
        }
        .ball .firstBallImg.ballAnimright {
          animation: ballAnimright 0.5s linear forwards;
        }
        @keyframes ballAnimright {
          0% {
            bottom: 3vh;
            left: 38vw;
            transform: scale(1);
          }
          to {
            bottom: 31.3vh;
            left: 74vw;
            transform: scale(0.6);
          }
        }
        .ball .firstBallImg.ballAnimCenter {
          animation: ballAnimCenter 0.5s linear forwards;
        }
        @keyframes ballAnimCenter {
          0% {
            bottom: 0;
            transform: scale(1);
            left: 50%;
            transform: translate(-50%);
          }
          to {
            bottom: 43.5vh;
            left: 50%;
            transform: translate(-50%) scale(0.6);
          }
        }
        .gateKeepper #gateKeeperSvg.gateKeepperLeftAnim {
          animation: gateKeepperLeftAnim 0.3s linear forwards;
        }
        .gateKeepper #gateKeeperSvg.gateKeepperRightAnim {
          animation: gateKeepperRightAnim 0.3s linear forwards;
        }
        @keyframes gateKeepperLeftAnim {
          0% {
            top: 60%;
            left: 50%;
            transform: translate(-50%, -40%);
          }
          to {
            top: 60%;
            left: 50%;
            transform: translate(-130%, -40%);
          }
        }
        @keyframes gateKeepperRightAnim {
          0% {
            top: 60%;
            left: 50%;
            transform: translate(-50%, -40%);
          }
          to {
            top: 60%;
            left: 50%;
            transform: translate(30%, -40%);
          }
        }
      }
      #rHand {
        transform: rotate(0);
        animation: rightHandAnim 1s linear infinite;
      }
      @keyframes rightHandAnim {
        0% {
          transform: rotate(0);
        }
        25% {
          transform: rotate(1deg);
        }
        50% {
          transform: rotate(0);
        }
        75% {
          transform: rotate(-0.7deg);
        }
        to {
          transform: rotate(0);
        }
      }
      #lHand {
        transform: translateY(0);
        animation: leftHandAnim 1s linear infinite;
      }
      @keyframes leftHandAnim {
        0% {
          transform: translateY(0);
        }
        25% {
          transform: translateY(1%);
        }
        50% {
          transform: translateY(0);
        }
        75% {
          transform: translateY(-1%);
        }
        to {
          transform: translateY(0);
        }
      }
      @media screen and (min-width: 820px) and (max-width: 820px) and (min-height: 1180px) and (max-height: 1180px) {
        .targetLeft img {
          top: 56%;
          left: 43%;
          transform: translate(-280%, -115%);
        }
        .targetCenter img {
          top: 56%;
          left: 50%;
          transform: translate(-50%, -115%);
        }
        .targetRight img {
          top: 60%;
          left: 52%;
          transform: translate(250%, 50%);
        }
        .ball .firstBallImg.ballAnimLeft {
          animation: ballAnimLeft 0.5s linear forwards;
        }
        @keyframes ballAnimLeft {
          0% {
            bottom: 3vh;
            left: 38vw;
            transform: scale(1);
          }
          to {
            bottom: 43.5vh;
            left: 20.7vw;
            transform: scale(0.6);
          }
        }
        .ball .firstBallImg.ballAnimright {
          animation: ballAnimright 0.5s linear forwards;
        }
        @keyframes ballAnimright {
          0% {
            bottom: 3vh;
            left: 38vw;
            transform: scale(1);
          }
          to {
            bottom: 31.3vh;
            left: 67.8vw;
            transform: scale(0.6);
          }
        }
        .ball .firstBallImg.ballAnimCenter {
          animation: ballAnimCenter 0.5s linear forwards;
        }
        @keyframes ballAnimCenter {
          0% {
            bottom: 0;
            transform: scale(1);
            left: 50%;
            transform: translate(-50%);
          }
          to {
            bottom: 43.5vh;
            left: 50%;
            transform: translate(-50%) scale(0.6);
          }
        }
      }
      @media screen and (min-width: 1180px) and (max-width: 1180px) and (min-height: 820px) and (max-height: 820px) {
        .ball .firstBallImg.ballAnimLeft {
          animation: ballAnimLeft 0.5s linear forwards;
        }
        @keyframes ballAnimLeft {
          0% {
            bottom: 3vh;
            left: 38vw;
            transform: scale(1);
          }
          to {
            bottom: 52.7vh;
            left: 28vw;
            transform: scale(0.6);
          }
        }
        .ball .firstBallImg.ballAnimright {
          animation: ballAnimright 0.5s linear forwards;
        }
        @keyframes ballAnimright {
          0% {
            bottom: 3vh;
            left: 38vw;
            transform: scale(1);
          }
          to {
            bottom: 33.3vh;
            left: 63.5vw;
            transform: scale(0.6);
          }
        }
        .ball .firstBallImg.ballAnimCenter {
          animation: ballAnimCenter 0.5s linear forwards;
        }
        @keyframes ballAnimCenter {
          0% {
            bottom: 0;
            transform: scale(1);
            left: 50%;
            transform: translate(-50%);
          }
          to {
            bottom: 52.7vh;
            left: 50%;
            transform: translate(-50%) scale(0.6);
          }
        }
      }
    </style>
  </head>

            }
          },

          parseRecurrenceArrayValue: function (recurrenceDict, kind) {
            if (recurrenceDict.hasOwnProperty(kind)) {
              var array = recurrenceDict[kind];
              if (!array || !(array instanceof Array)) {
                this.errors.push(kind + " must be an array.");
              } else {
                var arrayStr = array.join(",");
                this.arguments.push(kind);
                this.arguments.push(arrayStr);
              }
            }
          },

          parseRecurrenceInterval: function (recurrenceDict) {
            if (recurrenceDict.hasOwnProperty("interval")) {
              var interval = recurrenceDict.interval;
              if (!interval) {
                this.errors.push("Recurrence interval cannot be null.");
              } else {
                this.arguments.push("interval");
                this.arguments.push(interval);
              }
            } else {
              // If a recurrence rule was specified without an interval, use a default value of 1.
              this.arguments.push("interval");
              this.arguments.push(1);
            }
          },

          parseRecurrenceFrequency: function (recurrenceDict) {
            if (recurrenceDict.hasOwnProperty("frequency")) {
              var frequency = recurrenceDict.frequency;
              var validFrequencies = ["daily", "weekly", "monthly", "yearly"];
              if (contains(frequency, validFrequencies)) {
                this.arguments.push("frequency");
                this.arguments.push(frequency);
              } else {
                this.errors.push(
                  'Recurrence frequency must be one of: "daily", "weekly", "monthly", "yearly".'
                );
              }
            }
          },

          parseRecurrenceEndDate: function (recurrenceDict) {
            var expires = recurrenceDict.expires;

            if (!expires) {
              return;
            }

            this.arguments.push("expires");
            this.arguments.push(expires);
          },

          _getParameter: function (key) {
            if (this.parameters.hasOwnProperty(key)) {
              return this.parameters[key];
            }

            return null;
          },

          _processStringValue: function (kind) {
            if (this.parameters.hasOwnProperty(kind)) {
              var value = this.parameters[kind];
              this.arguments.push(kind);
              this.arguments.push(value);
            }
          },

          _processDateValue: function (kind) {
            if (this.parameters.hasOwnProperty(kind)) {
              var dateString = this._getParameter(kind);
              this.arguments.push(kind);
              this.arguments.push(dateString);
            }
          },
        };
      })();
    </script>
  </body>
</html>
